var q;
function runThrough(tran_dates){
  var keys = Object.keys(tran_dates).sort();
  q = new Queue();
  var i = 0;
  var p = setInterval(function(){
      if(i>=keys.length)
          return clearInterval(p)
      var moment = new Moment(tran_dates[keys[i]].trans);
      var current = tran_dates[keys[i]].date;
      moment.placeMarkers(10, function(){
        console.log("Displayed %s markers at, %s", moment.markers.length, current);
        q.enqueue(moment);
      });
      i++;
  }, 5000)

  setInterval(function(){
    var moment = q.dequeue();
    if(moment){
      //moment.removeMarkers(100);
      moment.removeMarkers(100);
    }
  }, 100)
}






/* Calculate Clusters */
function transToClusters(trans){
  var points    = generateLatLng(trans);
  return generateClusters(points);
}

//Turn trans into lat, lng objects
function generateLatLng(trans){
  var holder = [];
  for(var i=0; i<trans.length; i++){
    if(trans[i].cleanedData.location){
      if(trans[i].cleanedData.location.lat)
        holder.push({lat:trans[i].cleanedData.location.lat, lng:trans[i].cleanedData.location.lng})
    }
  }
  return holder
}


//Takes an array of lat, lng objects and plots
function plotPoints(points){
  var _points = [];
  for(var i = 0; i<points.length; i++){
    _points.push(createMarker(points[i].lat, points[i].lng));
  }
  return _points;
}


//Plot an array of clusters on the map --- 
//where clusters is less than icons.length, otherwise there will be colored icon overlap
function plotCluster(clusters){
  points = [];
  for(var i=0; i<clusters.length; i++){
    for(var t=0; t<clusters[i].points.length; t++){
      points.push(createMarker(clusters[i].points[t].lat, clusters[i].points[t].lng, icons[i%icons.length]));
    }
  }
  return points;
}


//Takes a lat and lng point, plus an optional i point for a colored marker
function createMarker(lat, lng, i) {
  if(!i) i =0;

  var latLng = new google.maps.LatLng(lat, lng);
  return new google.maps.Marker({
    map: map,
    position: latLng,
    icon:icons[i],
  });
}

//Markers is an array of markers
//marker is a single marker
function clearMap(markers, marker){
  if(marker)
    marker.setMap(null);
  if(markers && markers.length>-1){
    for(i in markers){
      markers[i].setMap(null);
    }
  }
}
















